import React from 'react'
import { withRouter } from 'react-router-dom'
import EachLine from './EachLine'

function ShowListMyOrders(props) {
    console.log(props.e.Order)
    return (
        <div>
             <li key={props.e.orderId} style={{display:"flex",margin:"5px"}} className="list-group-item">
                <div id="photoDiv">
                  <img id="imgOrder" src={props.e.Order.imgsrc} />
                </div>
                <div id="typeDiv">
                  <p id="orderIdText"> Id Item : {props.e.id}</p>
                  <p>quantity : {props.e.quantity}</p>
                  <p id="orderPriceText">Price : {props.e.price}$</p>
                </div>
              </li>
            );
        </div>
    )
}
export default withRouter(ShowListMyOrders)
